function TernaryQuartic_S3(D0)

    FF := Universe(D0);
    R := RationalFunctionField(FF, 2); a := R.1; b := R.2;
    S := PolynomialRing(R, 3); x := S.1; y := S.2; z := S.3;

    f := x^3*z + y^3*z + x^2*y^2 + a*x*y*z^2 + b*z^4;

    I, W := DixmierOhnoInvariants(f);
    inds := [ i : i in [1..#I] | I[i] ne 0 ];
    I := [ I[i] : i in inds ]; I0 := [ D0[i] : i in inds ]; W := [ W[i] : i in inds ];
    eqns1 := [ I[i] : i in [1..#I] | I0[i] eq 0 ];

    inds := [ i : i in [1..#I] | I0[i] ne 0 ];
    I := [ I[i] : i in inds ]; I0 := [ I0[i] : i in inds ]; W := [ W[i] : i in inds ];
    I := WPSNormalize(W, I); I0 := WPSNormalize(W, I0);
    eqns2 := [ Numerator(I[i]) - I0[i]*Denominator(I[i]) : i in [1..#I] ];

    eqns := eqns1 cat eqns2;

    A := AffineSpace(Parent(eqns2[1]));
    Sch := Scheme(A, eqns);

    Pts := Points(Sch); if #Pts eq 0 then Pts := PointsOverSplittingField(Sch); end if;

    f := S!0;
    for Pt in Pts do
        a, b := Explode(Eltseq(Pt));
        if not (a eq 0 and b eq 0) then
            S := PolynomialRing(Ring(Universe(Pts)), 3);
            x := S.1; y := S.2; z := S.3;
            f := x^3*z + y^3*z + x^2*y^2 + a*x*y*z^2 + b*z^4;
            break Pt;
        end if;
    end for;

    return f;

end function;


function TernaryQuartic_C3(DO)

    FF := Universe(DO);
    P3 := PolynomialRing(FF, 3); x := P3.1; y := P3.2; z := P3.3;

    I03,I06,I09,J09,I12,J12,I15,J15,I18,J18,I21,J21,I27 := Explode(DO);

    if J09 - 1/3*I09 eq 0 and J18 - 2/3*I18 eq 0 then
        vprint QuarticRec : "Dim. 1 model";
        b := 432*I18/I09^2;     /* I09 <> 0, otherwise the curve is singular */
        return x^3*z + y^4 + b*y*z^3 + b*z^4;
    end if;

    vprint QuarticRec : "Dim. 2 model :";

    if 18*I09^3-69*I09^2*J09+48*I09*J09^2-9*J09^3-40*I09*I18+180*I09*J18+80*I18*J09-180*J09*J18 eq 0 then
        vprint QuarticRec : "Deg. 27 inv eq 0 :";

        if I27 - 27*I09^3 eq 0 and J18 - 1/9*I18 eq 0 and J09 - 1/3*I09 eq 0 then
            a := 243/8*I18/(2*I09^2-9*I18); /* 2*I09^2-9*I18  <> 0, otherwise the curve is singular */
            b := 1/36*a^2 + 3/8*a;
            return x^3*z + y^4 + a*y^2*z^2 + a*y*z^3 + b*z^4;
        end if;

        a := -387420489/8*I09^3/(14348907*I09^3+1024*I27); /* 14348907*I09^3+1024*I27 <> 0, otherwise the curve is singular */
        b := -1/12*a^2;
        return x^3*z + y^4 + a*y^2*z^2 + a*y*z^3 + b*z^4;

    end if;

    if I18 eq 0 then

        vprint QuarticRec : "I18 eq 0 :";
        if I27 + 1610361/320*J09^3 - 102789/8*J09^2*I09 + 1904877/320*J09*I09^2 -
            123201/160*I09^3 eq 0 and J18 eq 0 then
            a := 27/40*(-3*J09+I09)/(3*I09-J09); /* 23*I09-J09  <> 0, otherwise the curve is singular */
            b := -5/108*a^2 + 1/8*a;
            return x^3*z + y^4 + a*y^2*z^2 + a*y*z^3 + b*z^4;
        end if;

        if I27 + 12895281/20480*J09^3 - 3781323/2560*J09^2*I09 +
            1861137/4096*J09*I09^2 - 385641/10240*I09^3 eq 0
            and J18 + 1/12*J09^2 - 7/36*J09*I09 + 1/18*I09^2 eq 0
            then
            a := 27/10*(-3*J09+I09)/(2*I09+J09);/* 2*I09+J09  <> 0, otherwise the curve is singular */
            b := -5/252*a^2 + 3/14*a;
            return x^3*z + y^4 + a*y^2*z^2 + a*y*z^3 + b*z^4;
        end if;

    end if;

    a :=
        81/40*(I09-3*J09)*(2*I09^2-7*I09*J09+3*J09^2+40*I18-60*J18)/(18*I09^3-69*I09^2*J09+48*I09*J09^2-9*J09^3-40*I09*I18+180*I09*J18+80*I18*J09-180*J09*J18);
    b :=
        1/14400*a*(1680*I09^2*a-1400*I09*J09*a+280*J09^2*a-378*I09^2+1323*I09*J09-6000*I18*a-567*J09^2+7200*J18*a-16200*I18+24300*J18)/I18;

    return x^3*z + y^4 + a*y^2*z^2 + a*y*z^3 + b*z^4;

end function;


function TernaryQuartic_D8_I12eq0(DO)

    FF := Universe(DO);
    P3 := PolynomialRing(FF, 3); x := P3.1; y := P3.2; z := P3.3;

    I03,I06,I09,J09,I12,J12,I15,J15,I18,J18,I21,J21,I27 := Explode(DO);

    if
        J09^2+2*J09*I09+I09^2+72*I09*I06*I03+9/2*I09*I03^3 eq 0
    and
        J09*I09*I03+12/5*J09*I03^4+I09^2*I03+240*I09*I06^2+84*I09*I06*I03^2+249/80*I09*I03^4+120*I06^3*I03-195/2*I06^2*I03^3+2433/160*I06*I03^5+3483/2560*I03^7 eq 0
    and
        J09*I06+21/80*J09*I03^2+I09*I06-3/80*I09*I03^2-6*I06^2*I03+33/20*I06*I03^3+81/640*I03^5 eq 0
    and
        I09^2*I03^3+800*I09*I06^3+510*I09*I06^2*I03^2+563/8*I09*I06*I03^4+333/128*I09*I03^6+400*I06^4*I03-220*I06^3*I03^3+107/8*I06^2*I03^5+297/64*I06*I03^7+729/4096*I03^9 eq 0
    then

        if 81*I03^3+1296*I03*I06+32*I09 eq 0 then
            if J09 + 31941/640*I03^3 eq 0 and
                I09 - 13689/640*I03^3 eq 0 and
                I06 + 189/320*I03^2 eq 0 then
                a := -5/26244;
                b := 1/54;
                return a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;
            end if;

            a := -7/20736;
            b := -1/24;
            return a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;
        end if;

        b := -1/72*(27*I03^3+432*I03*I06-176*I09-80*J09)/(81*I03^3+1296*I03*I06+32*I09);
        a := -11/36*b^2-1/216*b;
        return a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;
    end if;

    b := 1/72*(J09+13*I09)/(-3*J09+I09);
    a := 1/36*b^2*(72*b+17)/(72*b+1);

    return a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;

end function;


function TernaryQuartic_D8(D0)

    FF := Universe(D0);
    R := RationalFunctionField(FF, 2); a := R.1; b := R.2;

    S := PolynomialRing(R, 3);
    x := S.1; y := S.2; z := S.3;
    f := a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;

    I, W := DixmierOhnoInvariants(f);
    inds := [ i : i in [1..#I] | I[i] ne 0 ];
    I := [ I[i] : i in inds ]; I0 := [ D0[i] : i in inds ]; W := [ W[i] : i in inds ];
    eqns1 := [ I[i] : i in [1..#I] | I0[i] eq 0 ];

    inds := [ i : i in [1..#I] | I0[i] ne 0 ];
    I := [ I[i] : i in inds ]; I0 := [ I0[i] : i in inds ]; W := [ W[i] : i in inds ];
    I := WPSNormalize(W, I); I0 := WPSNormalize(W, I0);
    eqns2 := [ Numerator(I[i]) - I0[i]*Denominator(I[i]) : i in [1..#I] ];

    eqns := eqns1 cat eqns2;

    A := AffineSpace(Parent(eqns2[1]));
    Sch := Scheme(A, eqns);

    Pts := Points(Sch); if #Pts eq 0 then Pts := PointsOverSplittingField(Sch); end if;
    f := S!0;

    for Pt in Pts do
        a, b := Explode(Eltseq(Pt));
        if not (a eq 0 and b eq 0) then
            S := PolynomialRing(Ring(Universe(Pts)), 3);
            x := S.1; y := S.2; z := S.3;
            f := a*x^4 + y^4 + z^4 + b*x^2*y^2 + x*y*z^2;
            break Pt;
        end if;
    end for;

    return f;

end function;


/* This function essentially find solutions to the system

   l   * i03 = I03(a,b,c)
   l^2 * i06 = I06(a,b,c)
   l^3 * i09 = I09(a,b,c)
   l^3 * j09 = J09(a,b,c)
   l^4 * i12 = I12(a,b,c)
   l^4 * j12 = J12(a,b,c)
   ...

   where a, b, c and l are the unknowns and i03, i06, ... are the Dixmier-Ohno input.

   a and c can be easily expressed
 */
function TernaryQuartic_D4_I12eq0(DO)

    FF := Universe(DO);
    P3 := PolynomialRing(FF, 3); x := P3.1; y := P3.2; z := P3.3;

    I03,I06,I09,J09,I12,J12,I15,J15,I18,J18,I21,J21,I27 := Explode(DO);

    Dim2Model := func <
        a, b |
        x^4 + 2*x^2*y^2 + 2*a*x^2*y*z + (a^2-2*b)*x^2*z^2 + a*y^4 + 4*(a^2-2*b)*y^3*z + 6*(a^3-3*a*b)*y^2*z^2 + 4*(a^4-4*a^2*b + 2*b^2)*y*z^3 + (a^5-5*a^3*b+5*a*b^2)*z^4 >;

